import React, { Fragment } from 'react';
import Head from 'next/head';
const Home = () => {
    return (
        <Fragment>
            <Head>
                <title>Proyect1</title>
            </Head>
            <div>
                <h1>Hola Mundo</h1>
            </div>
        </Fragment>
    )
}

export default Home;
